import React, { Component } from 'react';
import { Card, Form, Col, Button } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSave, faPlusSquare } from '@fortawesome/free-solid-svg-icons';

export default class Voiture extends Component {
  constructor(props) {
    super(props);
    this.state = {
      marque: '',
      modele: '',
      couleur: '',
      annee: '',
      prix: '',
    };
    this.voitureChange = this.voitureChange.bind(this);
    this.submitVoiture = this.submitVoiture.bind(this);
  }
  submitVoiture(event) {
    alert(this.state.marque);
    event.preventDefault();
  }
  voitureChange(event) {
    this.setState({
      [event.target.name]: event.target.value,
    });
  }

  render() {
    const marginTop = {
      marginTop: "20px",
    };
    return (
      <div style={marginTop}>
        <Card className="border border-dark bg-dark text-white">
          <Card.Header>
            <FontAwesomeIcon icon={faPlusSquare} /> Ajouter Voiture
          </Card.Header>
          <Form onReset={this.resetVoiture} onSubmit={this.submitVoiture} id="VoitureFormId">
            <Card.Body>
              <Form.Row>
                <Form.Group as={Col} controlId="formGridMarque">
                  <Form.Label>Marque</Form.Label>
                  <Form.Control
                    required
                    type="text"
                    name="marque"
                    value={this.state.marque}
                    autoComplete="off"
                    onChange={this.voitureChange}
                    className={"bg-dark text-white"}
                    placeholder="Entrez Marque Voiture"
                  />
                </Form.Group>
                <Form.Group as={Col} controlId="formGridModele">
                  <Form.Label>Modèle</Form.Label>
                  <Form.Control
                    required
                    type="text"
                    name="modele"
                    value={this.state.modele}
                    autoComplete="off"
                    onChange={this.voitureChange}
                    className={"bg-dark text-white"}
                    placeholder="Entrez Modèle de Voiture"
                  />
                </Form.Group>
              </Form.Row>
              <Form.Row>
                <Form.Group as={Col} controlId="formGridCouleur">
                  <Form.Label>Couleur</Form.Label>
                  <Form.Control
                    required
                    type="text"
                    name="couleur"
                    value={this.state.couleur}
                    autoComplete="off"
                    onChange={this.voitureChange}
                    className={"bg-dark text-white"}
                    placeholder="Entrez Couleur de Voiture"
                  />
                </Form.Group>
                <Form.Group as={Col} controlId="formGridImmatricule">
                  <Form.Label>Immatricule</Form.Label>
                  <Form.Control
                    required
                    type="text"
                    name="immatricule"
                    value={this.state.immatricule}
                    autoComplete="off"
                    onChange={this.voitureChange}
                    className={"bg-dark text-white"}
                    placeholder="Entrez Immatricule de Voiture"
                  />
                </Form.Group>
              </Form.Row>
              <Form.Row>
                <Form.Group as={Col} controlId="formGridPrix">
                  <Form.Label>Prix</Form.Label>
                  <Form.Control
                    required
                    type="text"
                    name="prix"
                    value={this.state.prix}
                    autoComplete="off"
                    onChange={this.voitureChange}
                    className={"bg-dark text-white"}
                    placeholder="Entrez Prix de Voiture"
                  />
                </Form.Group>
                <Form.Group as={Col} controlId="formGridAnnee">
                  <Form.Label>Annee</Form.Label>
                  <Form.Control
                    required
                    type="text"
                    name="annee"
                    value={this.state.annee}
                    autoComplete="off"
                    onChange={this.voitureChange}
                    className={"bg-dark text-white"}
                    placeholder="Entrez Immatricule de Voiture"
                  />
                </Form.Group>
              </Form.Row>
            </Card.Body>
            <Card.Footer style={{ textAlign: "right" }}>
              <Button size="sm" variant="success" type="submit">
                <FontAwesomeIcon icon={faSave} /> Submit
              </Button>{" "}
              <Button size="sm" variant="info" type="reset">
                Reset
              </Button>
            </Card.Footer>
          </Form>
        </Card>
      </div>
    );
  }
}
